export class LoginFormComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isError: false,
            email: '',

        }
    }

    render() {
        return (
            <div id="mainDiv">
            <Card id="loginForm">
                <div className="authHeader">
                    <span>АВТОРИЗАЦІЯ</span>
                </div>
                <div className="loginGroup" style={{ width: "100%" }}>
                    <div className="formGroup">
                        <div style={{ margin: "auto" }}><TextField label="Електронна пошта" margin="normal" variant="outlined" /></div>
                    </div>
                    <div className="formGroup">

                    </div>
                    <div className="formGroup">
                        <Button variant="contained">Enter</Button>
                    </div>
                    <div className="formGroup">
                        <p><Link to="javascript:void(0);">Забули пароль?</Link><Link href="javascript:void(0);">Ввійти</Link></p>
                    </div>
                </div>
            </Card>
            </div>
        );
    }
}
